    componentDidMount(){
        const result = reqWeather(510100)
    }
    render() {
        const{currentTime}=this.state
        return (
            <div className="header">
                <div className="header-top">
                    <span>欢迎:admin</span>
                    <a href="javascript:">退出</a>
